	(14, '50651496', 'Cittadinanza con 10 anni', NULL, NULL, 150.0000, 0.0000, 'no_image.png', 1, 7, '20', '', '', '', '', '', NULL, 0, 0, '', NULL, NULL, NULL, '<p><strong xss="removed">Elenco documentazione per i domanda\r\ndi cittadinanza italiana con 10 anni di residenza</strong></p><ul><li>Permesso di soggiorno valido se scade\r\ncon ricevuta</li><li>Carta di identita valido</li><li>Codice fiscale/Tessera di sanitaria</li><li>Passaporto con valido</li><li>Stato di famiglia</li><li>Certificato di nascita con legalizazione\r\nda embaciata italiano in paese origine</li><li>Certificato di penale con legalizazione\r\nda embaciata italiano in paese origine è\r\nvalido per non più di sei mesi.</li><li><strong>Storico di residenza che\r\nprova 10 anni residenza continuativa</strong></li><li>Attestato di conoscenza della lingua\r\nitaliana non inferiore a levello B 1 o permesso di lungo periodo/illimitato</li><li>Versamento del contributo di € 250,00</li><li>Marca da bollo da 16 €</li><li>Reditto di ultimo tre anni</li><li>Risposta di 20 domanda</li><li>Spid id di richiedente</li></ul><p><strong>NB:</strong><strong> In caso in cui il\r\nrichiedente non sia in grado di presentare redditi sufficienti, può fare\r\nrichiesta con dichiarazione di mantenimento da un\'altra persona dello stato di\r\nfamiglia di primo o secondo grado. In questo caso, deve presentare una\r\ndichiarazione di mantenimento e documentazione di riconoscimento del\r\nmantenimento.</strong></p><p>Se sei entrato in Italia\r\nprima del 14° anno di età e se hai la residenza legale senza interruzioni sul\r\nterritorio italiano non è necessario produrre il certificato penale del tuo\r\nPaese di origine. L\'ordinamento italiano non\r\nriconosce la punibilità dei minori di 14 anni ( art.98 codice\r\npenale)<strong></strong></p>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'cittadinanza', NULL, 0.0000, NULL, 0, 0, NULL, 0),
	(15, '81858642', 'Domissione volontarie', NULL, NULL, 20.0000, 0.0000, 'no_image.png', 6, NULL, '', '', '', '', '', '', NULL, 1, 0, '', NULL, NULL, NULL, '<ul>\r\n<li><strong>Documento</strong> di identità in corso di validità</li><li>Email del lavorarore</li><li>Codice fiscale.</li><li>Tessera sanitaria.</li><li>Contratto di lavoro o busta paga.</li><li>Indirizzo PEC del datore di lavoro.</li></ul>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 'domissione-volontarie', NULL, 0.0000, NULL, 0, 0, NULL, 0),
	(16, '94752153', 'Cittadinanza con 05 anni', NULL, NULL, 150.0000, 0.0000, 'no_image.png', 1, 7, '20', '30', '', '', '', '', NULL, 3, 0, '', NULL, NULL, NULL, '<p><strong>Elenco documentazione per i domanda\r\ndi cittadinanza italiana con 05 anni di residenza</strong></p><ul>\r\n<li>Permesso di soggiorno valido se scade\r\ncon ricevuta</li><li>Carta di identita valido</li><li>Codice fiscale/Tessera di sanitaria</li><li>Passaporto con valido</li><li>Stato di famiglia</li><li>Atto di notarieta di nascita\r\nrilasciato da tribunale in Italia</li><li>Atto di notorietà di penale, rilasciato da un\r\ntribunale in Italia, è valido per non più di sei mesi.</li><li>Certificato di casellaria rilasciato da un tribunale in Italia, è valido\r\nper non più di sei mesi.</li><li>Certificato di carica prendenti rilasciato da\r\nun tribunale in Italia, è valido per non più di sei mesi.</li><li><strong>Storico di residenza che\r\nprova 05 anni residenza continuativa</strong></li><li>Attestato di conoscenza della lingua\r\nitaliana non inferiore a levello B 1 o permesso di lungo periodo/illimitato</li><li>Versamento del contributo di € 250,00</li><li>Marca da bollo da 16 €</li><li>Spid id di richiedente</li><li>Reditto di ultimo tre anni</li><li>Risposta di 20 domanda</li></ul><p><strong>NB: Richiesta di\r\ncittadinanza italiana con 05 anni di residenza può fare chi ha permesso di\r\nsoggiorno per motivi di asilo e deve aver compiuto 5 anni dal decreto positivo\r\ndella commissione o decreto del giudice di tribunale.</strong></p>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'cittadinanza-con-05-anni', NULL, 0.0000, NULL, 0, 0, NULL, 0),
	(17, '11111313', 'Cittadinanza con matrimonio', NULL, NULL, 150.0000, 0.0000, 'no_image.png', 1, NULL, '20', '20', '', '', '', '', NULL, 0, 0, '', NULL, NULL, NULL, '<p><strong xss="removed">Elenco documentazione per i domanda\r\ndi cittadinanza italiana con 10 anni di residenza</strong></p><ul>\r\n<li>Permesso di soggiorno valido se scade\r\ncon ricevuta</li><li>Carta di identita valido</li><li>Codice fiscale/Tessera di sanitaria</li><li>Passaporto con valido</li><li>Stato di famiglia</li><li>Certificato di nascita con legalizazione\r\nda embaciata italiano in paese origine</li><li>Certificato di penale con legalizazione\r\nda embaciata italiano in paese origine è\r\nvalido per non più di sei mesi.</li><li><strong>Storico di residenza che\r\nprova 10 anni residenza continuativa</strong></li><li>Attestato di conoscenza della lingua\r\nitaliana non inferiore a levello B 1 o permesso di lungo periodo/illimitato</li><li>Versamento del contributo di € 250,00</li><li>Marca da bollo da 16 €</li><li>Reditto di ultimo tre anni</li><li>Risposta di 20 domanda</li><li>Spid id di richiedente</li></ul><p><strong>NB:</strong><strong> In caso in cui il\r\nrichiedente non sia in grado di presentare redditi sufficienti, può fare\r\nrichiesta con dichiarazione di mantenimento da un\'altra persona dello stato di\r\nfamiglia di primo o secondo grado. In questo caso, deve presentare una\r\ndichiarazione di mantenimento e documentazione di riconoscimento del\r\nmantenimento.</strong></p><p>Se sei entrato in Italia\r\nprima del 14° anno di età e se hai la residenza legale senza interruzioni sul\r\nterritorio italiano non è necessario produrre il certificato penale del tuo\r\nPaese di origine. L\'ordinamento italiano non\r\nriconosce la punibilità dei minori di 14 anni ( art.98 codice\r\npenale)<strong></strong></p>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'cittadinanza-con-matrimonio', NULL, 0.0000, NULL, 0, 0, NULL, 0),
	(18, '69814884', 'NASpI', NULL, NULL, 0.0000, 0.0000, 'no_image.png', 6, NULL, '', '', '', '', '', '', NULL, 1, 0, '', NULL, NULL, NULL, '<ul><li>Copia carta d\'identità e codice fiscale del richiedente.</li><li>Permesso di siggiorno in corso di valido(se richiedente è staniera)</li><li>Ricevuta di rinovo permesso di soggirno(se permesso di soggiorno scade)</li><li>Email del richiedente</li><li>Numero cellulare del richiedente</li><li>Iban del richidente</li><li>Ultima busta paga.</li><li>Lettera di licenziamento o UNILAV*</li><li>Contratto di lavoro (se la richiesta di <strong>NASpI</strong> avviene a scadenza contratto tempo determinato)</li></ul><p xss=removed><strong><u>বাংলা</u></strong></p><ul>\r\n<li>কার্তাদিআইদেনতিতা/রেসিডেন্সসার্টিফিকেট, কদেসিফিসকালে,  বিদেশিদেরক্ষেত্রেপারমেসোদিসৌজর্ন্য;</li><li>কাজের কন্ট্রাক পেপার,\r\nকাজ শেষহওয়ার লেটার/চিঠি, কাজ থেকে অব্যহতি দেয়ার চিঠি;</li><li>সর্বশেষ বোন্তাপাগা না থাকলে তার আগের মাসের বোস্তা পাগা;</li><li>ব্যাংক এর ইভান;</li><li>মোবাইনং\r\nও ইমেইল এড্রেস;</li></ul>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'naspi', NULL, 0.0000, NULL, 0, 0, NULL, 0),
	(19, '11935354', 'NASpI -Agricultura', NULL, NULL, 0.0000, 0.0000, 'no_image.png', 6, NULL, '', '', '', '', '', '', NULL, 1, 0, '', NULL, NULL, NULL, '<ul><li>Copia carta d\'identità e codice fiscale del richiedente.</li><li>Permesso di siggiorno in corso di valido(se richiedente è staniera)</li><li>Ricevuta di rinovo permesso di soggirno(se permesso di soggiorno scade)</li><li>Email del richiedente</li><li>Numero cellulare del richiedente</li><li>Iban del richidente</li><li>Tutti busta paga.</li><li>Contrtto di lavoro o UNILAV*</li><li>Per i lavoratori coniugati codice fiscale del coniuge </li></ul>', 1, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'naspi-agricultura', NULL, 0.0000, NULL, 0, 0, NULL, 0),
