	(23, '50110542', 'Ricongungimento-famiglia', NULL, NULL, 150.0000, 0.0000, 'no_image.png', 1, 8, '20', '20', '', '', '', '', NULL, 3, 0, '', NULL, NULL, NULL, '<ul><li><strong>Permesso\r\ndi soggiorno valido se scade serve ricevuta di postele</strong></li><li><strong>Copia\r\ndel passaporto valido di richiedente e del familiare da ricongiungere</strong></li><li><strong>Codice\r\nfiscale di richiedente</strong></li><li><strong>Certificato\r\nstato di famiglia di richiedente</strong></li><li><strong>Contratto\r\ndi affitto,di comodato o proprietà</strong></li><li><strong>Ospitalia\r\n</strong></li><li><strong>Alloggiativa\r\ndi casa</strong></li><li><strong>Documentazione\r\nche attesta che il familiare è a carico</strong></li><li><strong>Documentazione\r\nche dimostra il rapporto di parentela</strong></li><li><strong>Dichiarazione\r\nmantenemento </strong></li><li><strong>Documentazione\r\nassicurazione o dichiarazione assicuraziore se voui ricongiure genitore età piu\r\ndi 65 anni</strong></li><li><strong>Modello\r\ns 2 se sei ospite e devi ricongiungere un familiare</strong></li><li><strong>Documento\r\ndi riconscimento chi fa firma sulla s 2</strong></li><li><strong>Modollo\r\ns 1 se sei ospite e devi ricongiungere solo il figlio/figlia minore degli\r\nanni14</strong></li><li><strong>Documento\r\ndi riconscimento chi fa firma sulla s 1</strong></li><li><strong>Modello\r\ns 3 se se sei un lavoratore subordinato</strong></li><li><strong>Documento\r\ndi riconscimento del proprietario e del datore di lavoro chi fa firma sulla s 3</strong></li><li><strong>Unilav\r\nse sei un lavoratore subordinato</strong></li><li><strong>Ultimo\r\ntre busta paga</strong></li><li>U<strong>ltimo\r\ncud/730/modulo unico</strong></li><li><strong>Copia\r\ndi partita iva se sei lavoratore autonomo</strong></li><li><strong>Camera\r\ndi commercio se sei lavoratore autonomo</strong></li><li><strong>Bilancio\r\nattuale</strong></li><li><strong>Documento\r\ndi ricoscimento o carta profesonalista di commercialista </strong></li><li><strong>Stato\r\ndi famiglia relatore alle persone che abitano nell’alloggio</strong></li></ul><p><strong></strong></p><p><strong>NB:Nel caso di domanda di ricongiungimento\r\nfamiliare di un solo figlio/figlia di età inferiore agli anni 14,non è\r\nnecessaria la certificazione di idoneità dell’alloggio,ma è sufficiente il\r\nconsenso del titolare dell’alloggio nel quale il minore effettivamente dimorerà</strong></p><p><strong>Il consenso va prestato sia dal proprietario\r\nche dal conduttore dell’alloggio,attraverso la compilazione del modello s 1</strong></p><p><strong>Agli stanieri titolare di permesso di soggiorno\r\nper asilo politico/protezione sussidiaria che presentino domanda di\r\nricongiungimento a favore dei prori familiari,non è richiesta la dimostrazione\r\ndella disponibilità di un alloggio conforme ai requisti igiencio-sanitar e di\r\nidoneità abitativa e non è\r\nrichiesto dimostrare documentazione di lavoro e reddito</strong></p>', 0, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'ricongungimento-famiglia', NULL, 0.0000, NULL, 0, 0, NULL, 0),
