	(31, '28956923', 'ISEE 2025 & Membership', NULL, NULL, 0.0000, 0.0000, 'no_image.png', 3, NULL, '', '', '', '', '', '', NULL, 2, 0, '', NULL, NULL, NULL, '<p><strong xss="removed">ISEE 2025 তৈরির জন্য প্রয়োজনীয় ডকুমেন্টস:</strong></p><p>ISEE (Indicatore della Situazione Economica Equivalente) প্রস্তুত করতে বিভিন্ন ডকুমেন্টের প্রয়োজন হয়, যা পরিবারের আর্থিক, সম্পত্তি, এবং ব্যক্তিগত অবস্থার উপর ভিত্তি করে। ২০২৫ সালের জন্য ডকুমেন্ট তালিকাটি নিচে দেওয়া হলো:</p><hr><h3><strong>1. ব্যক্তিগত তথ্য সম্পর্কিত ডকুমেন্ট:</strong></h3><ul><li>আবেদনকারীর এবং পরিবারের প্রত্যেক সদস্যের <strong>Codice Fiscale</strong>।</li><li>পরিচয়পত্র (যেমন: Carta d\'Identità/Patente বা পাসপোর্ট)।</li><li>বসবাসের ঠিকানার প্রমাণ (যেমন: Residenza সার্টিফিকেট )।</li></ul><hr><h3><strong>2. পরিবারের তথ্য:</strong></h3><ul><li>পরিবারের প্রতিটি সদস্যের তথ্য, বিশেষত একক পিতা-মাতা পরিবার হলে সংশ্লিষ্ট কাগজপত্র।</li><li>বিবাহ, বিচ্ছেদ, বা সন্তান অভিভাবকত্ব সম্পর্কিত কোনো আইনি নথি (যদি প্রযোজ্য হয়)।</li></ul><hr><h3><strong>3. আয়ের তথ্য (Redditi):</strong></h3><ul><li>পূর্ববর্তী বছরের (২০২৩) আয়ের প্রমাণপত্র, যেমন:<ul><li><strong>Certificazione Unica (CUD)</strong>।</li><li><strong>Modello 730</strong> বা <strong>Modello Redditi</strong>।</li></ul></li><li>সরকারি ভাতা বা পেনশনের তথ্য (যেমন: NASPI বা পেনসিয়ন)।</li><li>ব্যবসার আয় বা ফ্রিল্যান্সিং আয়ের বিবরণ।</li></ul><hr><h3><strong>4. সম্পত্তির তথ্য:</strong></h3><ul><li>বাড়ি বা অন্যান্য সম্পত্তির ক্যাডাস্ট্রাল তথ্য (Visura Catastale)।</li><li>ভাড়া থাকলে ভাড়ার চুক্তিপত্র (Contratto di Locazione)।</li></ul><hr><h3><strong>5. ব্যাঙ্ক এবং আর্থিক সম্পদের তথ্য:</strong></h3><ul><li>ব্যাঙ্ক বা পোস্ট অফিস অ্যাকাউন্টের <strong>Estratto Conto (স্টেটমেন্ট)</strong> (২০২৩ সালের ৩১ ডিসেম্বর পর্যন্ত) Saldo e Giacenza media 31/12/2023।</li><li>সঞ্চয়, শেয়ার, বন্ড, বা ফান্ড ইনভেস্টমেন্টের তথ্য Saldo e Giacenza media 31/12/2023। </li><li>প্রিপেইড কার্ডের ব্যালেন্স এবং লেনদেনের বিবরণ Saldo e Giacenza media 31/12/2023।</li></ul><hr><h3><strong>6. যানবাহনের তথ্য:</strong></h3><ul><li>পরিবারের মালিকানাধীন গাড়ি, মোটরসাইকেল বা অন্যান্য যানবাহনের তথ্য (রেজিস্ট্রেশন নাম্বার/ ডকুমেন্ট) ।</li></ul><hr><h3><strong>7. অন্যান্য বিশেষ ডকুমেন্ট (যদি প্রযোজ্য হয়):</strong></h3><ul><li>প্রতিবন্ধিতা বা গুরুতর চিকিৎসা খরচের প্রমাণপত্র।</li><li>Altri redditi (অন্য কোনো আয়ের উৎস)।</li><li>সন্তানের স্কুল বা ডে কেয়ারের জন্য প্রদেয় ব্যয়ের বিবরণ।</li></ul>', 0, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, 'isee-2025-for-membership', NULL, 0.0000, NULL, 0, 0, NULL, 0),
	(32, '14354676', '730/2025', NULL, NULL, 0.0000, 0.0000, 'no_image.png', 3, NULL, '', '', '', '', '', '', NULL, 2, 0, '', NULL, NULL, NULL, '<p><strong xss="removed">Modello 730 2025 প্রস্তুত করতে প্রয়োজনীয় ডকুমেন্টস</strong></p><p><strong>Modello 730</strong> হলো ইতালিতে একটি ট্যাক্স ডিক্লারেশন ফর্ম, যা সাধারণত কর্মচারী (ডিপেনডেন্ট) এবং পেনশনভোগীদের জন্য ব্যবহৃত হয়। এটি INPS অথবা CAF (Centro di Assistenza Fiscale) এর মাধ্যমে দাখিল করা হয়। ২০২৫ সালের জন্য <strong>Modello 730</strong> দাখিল করতে যে ডকুমেন্টগুলো প্রয়োজন হতে পারে, তা নিচে বিস্তারিত দেওয়া হলো:</p><hr>\r\n<h3><strong>1. ব্যক্তিগত তথ্য সম্পর্কিত ডকুমেন্ট:</strong></h3><ul>\r\n<li><strong>Codice Fiscale</strong> এবং পরিচয়পত্র (যেমন Carta d’Identità বা পাসপোর্ট)।</li><li>পরিবারের সদস্যদের Codice Fiscale (যদি তাদের জন্য কর সুবিধা দাবি করা হয়)।</li><li>বসবাসের ঠিকানা প্রমাণপত্র।</li></ul><hr>\r\n<h3><strong>2. আয়ের তথ্য (Redditi):</strong></h3><ul>\r\n<li>পূর্ববর্তী বছরের (২০২৪) আয় সম্পর্কিত নথি:\r\n<ul>\r\n<li><strong>Certificazione Unica (CU):</strong> কর্মক্ষেত্র বা পেনশনের জন্য।</li><li>অন্যান্য আয়ের বিবরণ (যেমন: ভাড়ার আয়, ফ্রিল্যান্স আয়, বা ব্যবসার আয়)।</li></ul></li><li><strong>কাজ হারানোর ভাতা বা সামাজিক সুবিধার প্রমাণ</strong> (যদি প্রযোজ্য হয়)।</li><li>পেনশন বা অন্যান্য সরকারি ভাতা প্রাপ্তির প্রমাণ।</li></ul><hr>\r\n<h3><strong>3. সম্পত্তি সম্পর্কিত ডকুমেন্ট:</strong></h3><ul>\r\n<li>নিজস্ব বা যৌথ মালিকানাধীন সম্পত্তির তথ্য (Visura Catastale)।</li><li>বাড়ি বা অ্যাপার্টমেন্টের ভাড়ার চুক্তিপত্র (Contratto di Locazione), যদি আপনি ভাড়া থেকে আয় পান।</li><li>প্রথম বাড়ি বা সেকেন্ডারি বাড়ি সম্পর্কিত সম্পত্তি করের প্রমাণপত্র।</li></ul><hr>\r\n<h3><strong>4. ব্যয় সম্পর্কিত ডকুমেন্ট:</strong></h3><p>কিছু কর ছাড়ের জন্য প্রয়োজনীয় ব্যয়ের রসিদ:</p><ul>\r\n<li><strong>চিকিৎসা খরচ:</strong> ডাক্তারের ফি, ওষুধ, চিকিৎসা পরীক্ষার খরচ।</li><li><strong>শিক্ষা খরচ:</strong> স্কুল বা বিশ্ববিদ্যালয়ের ফি।</li><li><strong>গৃহসংস্কার বা শক্তি সঞ্চয় প্রকল্প:</strong> বোনাস ফিসকালের জন্য বিল ও রসিদ।</li><li><strong>ইনস্যুরেন্স প্রিমিয়াম:</strong> জীবন বীমা বা দুর্ঘটনা বীমার জন্য।</li><li><strong>গৃহঋণ সুদ (Mutuo):</strong> ব্যাংকের রসিদ।</li><li><strong>দাতব্য অনুদান:</strong> আইনত অনুমোদিত সংস্থায় প্রদত্ত অনুদানের প্রমাণ।</li></ul><hr>\r\n<h3><strong>5. ব্যাঙ্ক এবং আর্থিক সম্পদের তথ্য:</strong></h3><ul>\r\n<li>ব্যাংক বা পোস্ট অফিস অ্যাকাউন্টের ব্যালেন্স।</li><li>প্রিপেইড কার্ডের বিবরণ।</li><li>শেয়ার, বন্ড বা অন্যান্য বিনিয়োগের তথ্য।</li></ul><hr>\r\n<h3><strong>6. বিশেষ অবস্থার জন্য ডকুমেন্ট:</strong></h3><ul>\r\n<li>সন্তানদের জন্য কর ছাড় দাবি করতে তাদের সম্পর্কিত ব্যয়ের তথ্য।</li><li>প্রতিবন্ধিতা সম্পর্কিত খরচ এবং ভাতার তথ্য।</li><li>বৈধ বিচ্ছেদের ক্ষেত্রে খোরপোষের প্রমাণ।</li></ul><hr>\r\n<h3><strong>730 দাখিল করার সময়সীমা:</strong></h3><ul>\r\n<li><strong>CAF বা পেট্রোনাটো-এর মাধ্যমে:</strong> সাধারণত মে থেকে সেপ্টেম্বরের মধ্যে দাখিল করা যায়।</li></ul>', 0, 'service', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '730-2025', NULL, 0.0000, NULL, 0, 0, NULL, 0),
